### Array Update Operators![](/docs/atlas/app-services/assets/link.svg)

Array operators let you work with values inside of arrays.

#### Push an Element Into an Array![](/docs/atlas/app-
services/assets/link.svg)

You can use the
[$push](https://www.mongodb.com/docs/manual/reference/operator/update/push/)
operator to add a value to the end of an array field.



    { "$push": { "<Array Field Name>": <New Array Element>, ... } }  
    ---  

#### Pop the Last Element out of an Array![](/docs/atlas/app-
services/assets/link.svg)

You can use the
[$pop](https://www.mongodb.com/docs/manual/reference/operator/update/pop/)
operator to remove either the first or last element of an array field. Specify
`-1` to remove the first element and `1` to remove the last element.



    { "$pop": { "<Array Field Name>": <-1 | 1>, ... } }  
    ---  

#### Add a Unique Element to an Array![](/docs/atlas/app-
services/assets/link.svg)

You can use the
[$addToSet](https://www.mongodb.com/docs/manual/reference/operator/update/addToSet/)
operator to add a value to an array field if that value is not already
included in the array. If the value is already present, `$addToSet` does
nothing.



    { "$addToSet": { "<Array Field Name>": <Potentially Unique Value>, ... } }  
    ---  

#### Remove Elements from an Array![](/docs/atlas/app-
services/assets/link.svg)

You can use the
[$pull](https://www.mongodb.com/docs/manual/reference/operator/update/pull/)
operator to remove all instances of any values that match a specified
condition from an array field.



    { "$pull": { "<Array Field Name>": <Value | Expression>, ... } }  
    ---  

#### Update All Elements in an Array![](/docs/atlas/app-
services/assets/link.svg)

You can use the [$[] (All Positional
Update)](https://www.mongodb.com/docs/manual/reference/operator/update/positional-
all/) operator to update all elements in an array field:

## Example

Consider a `students` collection that describes individual students in a
class. The documents each include a `grades` field that contains an array of
numbers:



    { "_id" : 1, "grades" : [ 85, 82, 80 ] }  
    ---  
    { "_id" : 2, "grades" : [ 88, 90, 92 ] }  
    { "_id" : 3, "grades" : [ 85, 100, 90 ] }  

The following update operation adds 10 to all values in the `grades` array of
every student:



    await students.updateMany(  
    ---  
       {},  
