## Run an Aggregation Pipeline![](/docs/atlas/app-services/assets/link.svg)

You can execute an aggregation pipeline using the
[`collection.aggregate()`](/docs/atlas/app-
services/functions/mongodb/api/#mongodb-method-collection.aggregate) method.

The following [function](/docs/atlas/app-services/functions/#std-label-
functions) snippet groups all documents in the `purchases` collection by their
`customerId` value and aggregates a count of the number of items each customer
purchases as well as the total number of purchases that they made. After
grouping the documents the pipeline adds a new field that calculates the
average number of items each customer purchases at a time,
`averageNumItemsPurchased`, to each customer's document:



    const pipeline = [  
    ---  
      { "$group": {  
          "_id": "$customerId",  
          "numPurchases": { "$sum": 1 },  
          "numItemsPurchased": { "$sum": { "$size": "$items" } }  
      } },  
      { "$addFields": {  
          "averageNumItemsPurchased": {  
            "$divide": ["$numItemsPurchased", "$numPurchases"]  
          }  
      } }  
    ]  

    return purchasesCollection.aggregate(pipeline).toArray()  
      .then(customers => {  
        console.log(`Successfully grouped purchases for ${customers.length} customers.`)  
        for(const customer of customers) {  
          console.log(`customer: ${customer._id}`)  
          console.log(`num purchases: ${customer.numPurchases}`)  
          console.log(`total items purchased: ${customer.numItemsPurchased}`)  
          console.log(`average items per purchase: ${customer.averageNumItemsPurchased}`)  
        }  
        return customers  
      })  
      .catch(err => console.error(`Failed to group purchases by customer: ${err}`))  

### Find Data with Atlas Search![](/docs/atlas/app-services/assets/link.svg)

You can run [Atlas Search](https://www.mongodb.com/docs/atlas/atlas-
search/#std-label-fts-top-ref) queries on a collection with
[`collection.aggregate()`](/docs/atlas/app-
services/functions/mongodb/api/#mongodb-method-collection.aggregate) and the
`$search` aggregation stage.

## Important

App Services performs `$search` operations as a system user and enforces
field-level rules on the returned search results. This means that a user may
search on a field for which they do not have read access. In this case, the
search is based on the specified field but no returned documents include the
field.



    exports = async function searchMoviesAboutBaseball() {  
    ---  
      // 1. Get a reference to the collection you want to search.  
      const movies = context.services  
        .get("mongodb-atlas")  
        .db("sample_mflix")  
        .collection("movies");  
      // 2. Run an aggregation with $search as the first stage.  
      const baseballMovies = await movies  
        .aggregate([  
          {  
            $search: {  
              text: {  
                query: "baseball",  
                path: "plot",  
              },  
            },  
          },  
          {  
            $limit: 5,  
          },  
          {  
            $project: {  
              _id: 0,  
              title: 1,  
              plot: 1,  
            },  
          },  
        ])  
        .toArray();  
      return baseballMovies;  
    };  

