       {},  
       { $inc: { "grades.$[]": 10 } },  
    )  

After the update, every grade value has increased by 10:



    { "_id" : 1, "grades" : [ 15, 92, 90 ] }  
    ---  
    { "_id" : 2, "grades" : [ 18, 100, 102 ] }  
    { "_id" : 3, "grades" : [ 15, 110, 100 ] }  

#### Update Specific Elements in an Array![](/docs/atlas/app-
services/assets/link.svg)

You can use the [$[element] (Filtered Positional
Update)](https://www.mongodb.com/docs/manual/reference/operator/update/positional-
filtered/) operator to update specific elements in an array field based on an
array filter:

## Example

Consider a `students` collection that describes individual students in a
class. The documents each include a `grades` field that contains an array of
numbers, some of which are greater than 100:



    { "_id" : 1, "grades" : [ 15, 92, 90 ] }  
    ---  
    { "_id" : 2, "grades" : [ 18, 100, 102 ] }  
    { "_id" : 3, "grades" : [ 15, 110, 100 ] }  

The following update operation sets all grade values greater than 100 to
exactly 100:



    await students.updateMany(  
    ---  
       { },  
       {  
         $set: {  
           "grades.$[grade]" : 100  
         }  
       },  
       {  
         arrayFilters: [{ "grade": { $gt: 100 } }]  
       }  
    )  

After the update, all grade values greater than 100 are set to exactly 100 and
all other grades are unaffected:



    { "_id" : 1, "grades" : [ 15, 92, 90 ] }  
    ---  
    { "_id" : 2, "grades" : [ 18, 100, 100 ] }  
    { "_id" : 3, "grades" : [ 15, 100, 100 ] }  

## Delete![](/docs/atlas/app-services/assets/link.svg)

Delete operations find existing documents in a MongoDB collection and remove
them. You use standard MongoDB query syntax to specify which documents to
delete.

### Delete a Single Document (`deleteOne()`)![](/docs/atlas/app-
services/assets/link.svg)

You can delete a single document from a collection using the
[`collection.deleteOne()`](/docs/atlas/app-
services/functions/mongodb/api/#mongodb-method-collection.deleteOne) method.

The following [function](/docs/atlas/app-services/functions/#std-label-
functions) snippet deletes one document in the `items` collection that has a
`name` value of `lego`:



    const query = { "name": "lego" };  
    ---  

    itemsCollection.deleteOne(query)  
      .then(result => console.log(`Deleted ${result.deletedCount} item.`))  
      .catch(err => console.error(`Delete failed with error: ${err}`))  

### Delete One or More Documents (`deleteMany()`)![](/docs/atlas/app-
services/assets/link.svg)

You can delete multiple items from a collection using the
[`collection.deleteMany()`](/docs/atlas/app-
services/functions/mongodb/api/#mongodb-method-collection.deleteMany) method.

The following snippet deletes all documents in the `items` collection that do
not have any `reviews`:



    const query = { "reviews": { "$size": 0 } };  
    ---  

    itemsCollection.deleteMany(query)  
      .then(result => console.log(`Deleted ${result.deletedCount} item(s).`))  
      .catch(err => console.error(`Delete failed with error: ${err}`))  

## Bulk Writes![](/docs/atlas/app-services/assets/link.svg)

A bulk write combines multiple write operations into a single operation. You
can issue a bulk write command using the
[`collection.bulkWrite()`](/docs/atlas/app-
services/functions/mongodb/api/#mongodb-method-collection.bulkWrite) method.



    exports = async function(arg){  
    ---  
        const doc1 = { "name": "velvet elvis", "quantity": 20, "reviews": [] };  
        const doc2 = { "name": "mock turtleneck",  "quantity": 30, "reviews": [] };  

        var collection = context.services.get("mongodb-atlas")  
            .db("store")  
            .collection("purchases");  

        return await collection.bulkWrite(  
            [{ insertOne: doc1}, { insertOne: doc2}],  
            {ordered:true});  
    };  

## Transactions![](/docs/atlas/app-services/assets/link.svg)

MongoDB supports [multi-document
transactions](https://www.mongodb.com/docs/manual/core/transactions/) that let
you read and write multiple documents atomically, even across collections.

To perform a transaction:

  1. Obtain and start a client session with `client.startSession()`.

  2. Call `session.withTransaction()` to define the transaction. The method takes an async callback function and, optionally, a configuration object that defines custom [read and write settings](https://www.mongodb.com/docs/manual/core/transactions/#read-concern-write-concern-read-preference) for the transaction.

        session.withTransaction(async () => {  
    ---  
       // ... Run MongoDB operations in this callback  
    }, {  
        readPreference: "primary",  
        readConcern: { level: "local" },  
        writeConcern: { w: "majority" },  
    })  

  3. In the transaction callback function, run the MongoDB queries that you would like to include in the transaction. Be sure to pass the `session` to each query to ensure that it is included in the transaction.

        await accounts.updateOne(  
    ---  
      { name: userSubtractPoints },  
      { $inc: { browniePoints: -1 * pointVolume } },  
      { session }  
    );  

  4. If the callback encounters an error, call `session.abortTransaction()` to stop the transaction. An aborted transaction does not modify any data.

        try {  
    ---  
      // ...  
    } catch (err) {  
      await session.abortTransaction();  
    }  

  5. When the transaction is complete, call `session.endSession()` to end the session and free resources.

        try {  
    ---  
      // ...  
    } finally {  
      await session.endSession();  
    }  


The following example creates two users, "henry" and "michelle", and a uses a
transaction to move "browniePoints" between those users atomically:



