## Overview![](/docs/atlas/app-services/assets/link.svg)

The examples on this page demonstrate how to use the MongoDB Query API in a
function to aggregate documents in your Atlas cluster.

MongoDB [aggregation
pipelines](https://www.mongodb.com/docs/manual/core/aggregation-pipeline/) run
all documents in a collection through a series of data aggregation stages that
allow you to filter and shape documents as well as collect summary data about
groups of related documents.

## Note

### Supported Aggregation Stages

Atlas App Services supports nearly all MongoDB aggregation pipeline stages and
operators, but some stages and operators must be executed within a [system
function](/docs/atlas/app-services/functions/#std-label-system-functions). See
[Aggregation Framework Limitations](/docs/atlas/app-services/mongodb/crud-and-
aggregation-apis/#std-label-mongodb-crud-and-aggregation-apis-aggregation) for
more information.

### Data Model![](/docs/atlas/app-services/assets/link.svg)

The examples on this page use a collection named `store.purchases` that
contains information about historical item sales in an online store. Each
document contains a list of the purchased `items`, including the item `name`
and the purchased `quantity`, as well as a unique ID value for the customer
that purchased the items.



    {  
