      "title": "Purchase",  
      "required": ["_id", "customerId", "items"],  
      "properties": {  
        "_id": { "bsonType": "objectId" },  
        "customerId": { "bsonType": "objectId" },  
        "items": {  
          "bsonType": "array",  
          "items": {  
            "bsonType": "object",  
            "required": ["name", "quantity"],  
            "properties": {  
              "name": { "bsonType": "string" },  
              "quantity": { "bsonType": "int" }  
            }  
          }  
        }  
      }  
    }  

