## Note

### $$SEARCH_META Variable Availability

The [$$SEARCH_META](https://www.mongodb.com/docs/atlas/atlas-search/query-
syntax/#aggregation-variable) aggregation variable is only available for
functions that [run as system](/docs/atlas/app-services/functions/#std-label-
system-functions) or if the first role on the searched collection has its
`apply_when` and `read` expressions set to `true`.

If neither of these two scenarios apply, `$$SEARCH_META` is undefined and the
aggregation will fail.

## Aggregation Stages![](/docs/atlas/app-services/assets/link.svg)

### Filter Documents![](/docs/atlas/app-services/assets/link.svg)

You can use the
[$match](https://www.mongodb.com/docs/manual/reference/operator/aggregation/match/)
stage to filter incoming documents using standard MongoDB [query
syntax.](https://www.mongodb.com/docs/manual/tutorial/query-documents/)



    {  
    ---  
      "$match": {  
        "<Field Name>": <Query Expression>,  
        ...  
      }  
    }  

## Example

The following `$match` stage filters incoming documents to include only those
where the `graduation_year` field has a value between `2019` and `2024`,
inclusive.



    {  
    ---  
      "$match": {  
        "graduation_year": {  
          "$gte": 2019,  
          "$lte": 2024  
        },  
      }  
    }  

### Group Documents![](/docs/atlas/app-services/assets/link.svg)

You can use the
[$group](https://www.mongodb.com/docs/manual/reference/operator/aggregation/group/)
stage to aggregate summary data for groups of one or more documents. MongoDB
groups documents based on the `_id` expression.

## Note

You can reference a specific document field by prefixing the field name with a
`$`.



    {  
    ---  
      "$group": {  
        "_id": <Group By Expression>,  
        "<Field Name>": <Aggregation Expression>,  
        ...  
      }  
    }  

## Example

The following `$group` stage groups documents by the value of their
`customerId` field and calculates the number of purchase documents that each
`customerId` appears in.



    {  
    ---  
      "$group": {  
        "_id": "$customerId",  
        "numPurchases": { "$sum": 1 }  
      }  
    }  

### Project Document Fields![](/docs/atlas/app-services/assets/link.svg)

You can use
